import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import './index.css';
import reportWebVitals from './reportWebVitals';
import Home from './pages/Home';
import Header from './components/Header';
import Particle from './components/Particle';
import Page from './components/Page';
import Users from './pages/Users'
import axios from 'axios'

const nav = [
  { name: 'ToDo', href: '/' },
  { name: 'Users', href: '/users' },
]

let users = [
  {first_name:"Nick", last_name:"D", uid:"1"},
  {first_name:"Chuck", last_name:"Norris", uid:"2"},
]

async function getCustomersData() {
  let res = await fetch("http://127.0.0.1:5001/api/users", {mode: "no-cors",})
  let json = await res.json()
  console.log(json)

};

getCustomersData();


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>

    <Particle />
    <Header navigation={nav}/>

    <Routes>
      <Route path="/" element={<Page content={<Home users={users}/>} />} />
      <Route path="/users" element={<Page content={<Users users={users}/>} />} />
    </Routes>

  </BrowserRouter>

);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
